                    <Route path='/login' component={Login}/>
                    <Route path='/userpage' component={Userpage}/>
                    <Route path='/science' component={Science}/>
                    <Route path='/literature' component={Literature}/>

                </Switch>


            </BrowserRouter>




            )
    }
}


export default Parent;
